B.EH=new A.bg(B.Bu,0,4,B.rJ,4,"This weapon is a gun that shoots wrecked vehicles instead of bullets.\n\nWhen Front- or Side-mounted, the weapon fires like a trebuchet. The attacker places a penny-sized marker within Double range of the Lobber's fire Arc and rolls a Skid Die. For a Shift result, place a Wreck in any orientation, touching the marker (Collision Window). For a Spin or Slide result, the player to the left of of the attacker places a Wreck anywhere within Short range of the marker (Collision Window). For a Hazard result, the player to the left of the attacker places a Wreck touching the attacker's vehicle (Collision Window).\n\nRear-mounted Lobbers act as dumpers, dropping a Wreck behind the attacking vehicle, in contact with its rear (no Collision Window).\n\nIf a vehicle sporting a Lobber collides with a Wreck, it may gain 1 Ammo Token for the weapon.",36,"wreckLobber")
